import config from '@/config';
import Generator from '@/webApi/generator'
export default new Generator({
     //获取文件上传列表
     GetFileUploadList: {url: '/FileUploadDetailService/GetFileUploadList', method: 'post'},

     // 获取文件下载Url地址
     GetUploadUrl: {url: '/FileUploadDetailService/GetUploadUrl', method: 'post'},

     // 获取生产文件上传文件日志列表
     GetProduceFileUploadLogList: {url: '/FileUploadDetailService/GetProduceFileUploadLogList', method: 'post'},

     // 获取物流文件上传文件日志列表
     GetLogisticsFileUploadLogList: {url: '/FileUploadDetailService/GetLogisticsFileUploadLogList', method: 'post'},

     // 获取推送异常文件列表
     GetPushExceptionFileList: {url: '/PushOEMFileService/GetPushExceptionFileList', method: 'post'},

     //查询已推送文件列表
     GetPushOEMFileList: {url: '/pushOEMFileService/GetPushOEMFileList', method: 'post'},

     //获取下载文件列表
     GetFileDownloadList: {url: '/FileUploadDetailService/GetFileDownloadList', method: 'post'},

     //获取接口系统日志列表
     GetApiSystemList: {url: '/ApiSystemService/GetApiSystemList', method: 'post'},


}, config.pgyerApiUrl);
